import styled from "@emotion/styled";
import React from "react";
import J from "../images/J.png"
import JHL from "../images/JHL.png"
import O from "../images/O.png"
import H from "../images/H.png"
import N from "../images/N.png"
import S from "../images/S.png"
import C from "../images/C.png"
import H2 from "../images/H2.png"
import R from "../images/R.png"
import I from "../images/I.png"
import E from "../images/E.png"
import M from "../images/M.png"
import E2 from "../images/E2.png"
import R2 from "../images/R2.png"
import About from './About'
import { Footer } from "../components/Footer";


const tablet = `@media (max-width: 800px)`;
const mobile = `@media (max-width: 500px)`;

const LetterContainer = styled.div`
  max-width: 500px;
`

const LetterJOHN = styled.img`
width: 170px;
height: 170px;
  &:hover {
    background: url(${O});
  }
`
const LetterJ = styled.img`
width: 170px;
height: 170px;
  background-image: url(require(${J}));
  &:hover {
    background: url(${JHL});
  }
`

const Letter = styled.img`
width: 220px;
`

const LetterER = styled.img`
width: 180px;
height: 230px;
`

const LetterM= styled.img`
width: 300px;
height: 320px;
padding-right: 20px;
`

function Home() {
  return (
    <div>
      <LetterContainer>
      <div style={{ display: "flex", paddingBottom: "20px"}}>
      <LetterJ/>
      {/*<LetterO/>
      <LetterH/>
      <LetterN/>*/}
      </div>
      <div style={{ display: "flex", paddingBottom: "20px"}}>
      <Letter src={S} />
      <Letter src={C} />
      <Letter src={H2} />
      </div>
      <div style={{ display: "flex", paddingBottom: "20px"}}>
      <Letter src={R} />
      <Letter src={I} />
      <Letter src={E} />
      </div>
      <div style={{ display: "flex", paddingBottom: "20px"}}>
      <LetterM src={M} />
      <LetterER src={E2} />
      <LetterER src={R2} />
      </div>
      </LetterContainer>
      <Footer />
    </div>
  );
}

export default Home;
